import React from 'react'

class SearchResults extends React.Component{
    render(){
        return(
            <div className='SearchResults'>
                {this.props.results.map(item=>(
                    <>
                    <h1>START</h1>
                    <h1>{item.displayLink}</h1>
                    <li>{item.title}</li>
                    <li>{item.snippet}</li>
                    <li>{item.link}</li>
                    <h1>END</h1>
                    </>
                ))}
            </div>
        )
    }
}

export default SearchResults
